61884211.Content:
Ce médicament est contre-indiqué dans les situations suivantes :
· hypersensibilité à la substance active ou à lun des excipients mentionnés à la rubrique 6.1 ;
· antécédents d'allergie ou d'asthme déclenchés ou non par la prise d'acide tiaprofénique ou de substances d'activité proche telles quautres AINS, acide acétylsalicylique ;
· grossesse, à partir du début du 6ème mois (au-delà de 24 semaines daménorrhée) (voir rubrique 4.6) ;
· antécédents d'hémorragie ou de perforation digestive au cours d'un précédent traitement par AINS ;
· hémorragie en cours, ulcère peptique évolutif, antécédents d'ulcère peptique ou d'hémorragie récurrente (2 épisodes distincts, ou plus, d'hémorragie ou d'ulcération objectivés) ;
· insuffisance hépatocellulaire sévère ;
· insuffisance rénale sévère ;
· insuffisance cardiaque sévère ;
· enfant de moins de 15 kg, soit environ de moins de 4 ans (en raison du caractère inadapté du dosage unitaire).

60970141.Content:
Ce médicament ne doit pas être utilisé dans les cas suivants :
· cholécystite aiguë ;
· angiocholite ;
· obstruction complète des voies biliaires ;
· vésicule scléro-atrophiques ;
· hypersensibilité à la substance active ou à l'un des excipients mentionnés à la rubrique 6.1 ;
· échec de l'hépato-porto-entérostomie ou absence de la restauration dun flux biliaire chez lenfant ayant une atrésie des voies biliaires.
